function serialize(e){if(e&&"FORM"===e.nodeName){var s,n,t=[];for(s=e.elements.length-1;s>=0;s-=1)if(""!==e.elements[s].name)switch(e.elements[s].nodeName){case"INPUT":switch(e.elements[s].type){case"text":case"search":case"hidden":case"password":case"button":case"reset":case"submit":t.push(encodeURIComponent(e.elements[s].value));break;case"checkbox":case"radio":e.elements[s].checked&&t.push(e.elements[s].name+"="+encodeURIComponent(e.elements[s].value))}break;case"TEXTAREA":t.push(e.elements[s].name+"="+encodeURIComponent(e.elements[s].value));break;case"SELECT":switch(e.elements[s].type){case"select-one":t.push(e.elements[s].name+"="+encodeURIComponent(e.elements[s].value));break;case"select-multiple":for(n=e.elements[s].options.length-1;n>=0;n-=1)e.elements[s].options[n].selected&&t.push(e.elements[s].name+"="+encodeURIComponent(e.elements[s].options[n].value))}break;case"BUTTON":switch(e.elements[s].type){case"reset":case"submit":case"button":t.push(e.elements[s].name+"="+encodeURIComponent(e.elements[s].value))}}return t.join("&")}}